            resourcedetail:
              '<p>        <span style="color: black;">为丰富我县人民群众春节期间的文化生活，营造欢乐、祥和的节日氛围，1月15日晚7点，汉寿县2020年迎春音乐会在龙阳国际大酒店隆重举行，来自全县的400多名音乐爱好者欢聚一堂，喜迎新春佳节。</span></p><p><br></p><p><span style="color: black;">        音乐会在萨克斯重奏《红旗颂》中拉开序幕。《乘着歌声的翅膀》、《鸿雁》等歌曲很好地展现出了表演者扎实的演唱功底;大提琴齐奏《诺尔克大调协奏曲》、二胡与小提琴（合奏）《卡农》、京胡独奏《迎春》等乐器演奏，实现了西洋乐器与中国传统乐器的相互碰撞，充分展现了演奏者娴熟的演奏技巧，现场听众们沉浸在音乐的海洋之中;《我的家乡洞庭湖》、《把一切献给党》等歌曲唱出了对美丽家乡的赞美，对中国共产党的礼赞。</span></p><p><br></p><p><span style="color: black;">        整场音乐会十六个节目，时而宛转悠扬，时而激情四射，惊喜不断，异彩纷呈，听众感受到了音乐的魅力，现场掌声不断。</span></p><p><br></p><p><span style="color: black;">        本次音乐会由中共汉寿县委宣传部、县文旅广体局主办，县音乐家协会、县文化馆承办。县人大副主任王立芬，县人民政府副县长钟黎，县政协副主席李明桂，县文旅广体局党组副书记、副局长邓文、副局长杨冬英等领导出席并观摩音乐会。</span></p><p><br></p><p><img src="http://220.248.167.22/statics/image/2020/11/19/image_1605775170092.jpg"></p><p><br></p><p><img src="http://220.248.167.22/statics/image/2020/11/19/image_1605775175058.jpg"></p><p><br></p><p><img src="http://220.248.167.22/statics/image/2020/11/19/image_1605775179394.jpg"></p><p><br></p><p><img src="http://220.248.167.22/statics/image/2020/11/19/image_1605775183891.jpg"></p>',
