            auditdesc: "",
            resourcedetail:
              '<p>报名时间：4月1日-5月25日</p><p>对象招生：具备一定舞蹈基础的文艺爱好者</p><p>文员年龄：65岁以下（男女不限）</p><p>开课时间：以文化馆电话或信息通知为准</p><p>招生人数：60人</p><p>活动地址：汉寿县文化馆（龙阳中路工人文化宫6楼）</p><p><br></p><p>教师简介：邓静，毕业于云南艺术学院舞蹈系，国家三级演员，现任汉寿县文化馆副馆长。擅长民族民间舞、古典舞教学。</p><p><img src="http://220.248.167.22/statics/image/2021/04/02/image_1617356496635.jpg"></p><p><br></p><p>教师简介：魏琴，毕业于海南师范大学舞蹈系，本科，现任子歌艺术学校校长，擅长少儿中国舞、成人古典舞教学。</p><p><img src="http://220.248.167.22/statics/image/2021/04/03/image_1617443144637.png"></p><p><br></p><p>温馨提示：<strong>如号码填写有误，不能及时通知到，视为无效报名。</strong></p><p><br></p><p><img src="http://220.248.167.22/statics/image/2021/04/01/image_1617262245088.jpg"></p>',
