            updatetime: "20210107151440",
            auditor: 1,
            audittime: "20210107155459",
            auditdesc: "",
            resourcedetail:
              '<p> <span style="color: rgb(34, 34, 34);">为庆祝“三·八”妇女节，弘扬雷锋精神，丰富全县妇女文化生活，特举办2019年“我是雷锋家乡人，湖湘文化送春风”庆“三·八”文化志愿服务活动。通过活动的开展，促使广大妇女充分发挥“自尊、自信、自立、自强”精神，</span><span style="color: black;">做</span><a href="http://www.xuexila.com/lunwen/culture/social/" rel="noopener noreferrer" target="_blank" style="color: black;">社会</a><a href="http://www.xuexila.com/news/wenhua/" rel="noopener noreferrer" target="_blank" style="color: black;">文化</a><span style="color: black;">进步的推动者，成为实现中国梦不可或缺的力量。为顺利开展此次活动，特制定方案如下：</span></p><p> <span style="color: black;">一、指导思想</span></p><p> <span style="color: rgb(34, 34, 34);">以党的十九大为指导，践行社会主义核心价值观，弘扬雷锋精神，实现中华民族伟大复兴的中国梦，以文化志愿服务活动为载体，创新文化志愿服务形式，引导人民在发展先进文化，抵制有害文化，引领社会进步做出自己的努力。</span></p><p> <span style="color: rgb(34, 34, 34);">二、活动主题</span></p><p> <span style="color: rgb(34, 34, 34);">“我是雷锋家乡人，湖湘文化送春风”</span></p><p> <span style="color: rgb(34, 34, 34);">庆“三·八”文艺演出</span></p><p> 三、组织机构</p><p> 主办单位：汉寿县文旅广体局</p><p> 承办单位：汉寿县文化馆</p><p>        汉寿县非遗中心</p><p>        丰家铺镇鹿溪村</p><p> 四、活动时间、地点</p><p> 时间：2019年3月8日</p><p> 地点：丰家铺镇鹿溪村</p><p> 五、工作职责</p><p> 下设三个工作组：即节目组、后勤组、保卫组，其工作职责如下：</p><p> <strong>1、节目组</strong>：组 长：徐铁军</p><p> 副组长：罗先明、聂晓劲、白莉</p><p> ①负责节目审定</p><p> ②负责落实节目</p><p> ③负责声乐、舞蹈、器乐等节目形式的排练与辅导编排</p><p> ④负责节目的顺序与节目单</p><p> <strong>2、后勤组</strong>：组 长：刘桂堂</p><p> 成 员: 朱立新、张莉芳、曹培培</p><p>① 负责演出音频搜集、播放</p><p>② 负责音响器材的租用</p><p>③ 负责演出节目的调度</p><p>④ 负责演出信息报导</p><p> <strong>3、保卫组</strong>：组 长：聂晓劲</p><p> 成 员：刘海洪、周飞、刘晓明</p><p>  ①负责活动主持</p><p>②负责剧务工作</p><p>③负责演出现场的安全保卫工作</p><p>④负责演出现场摄像、图片采集</p><p> 六、工作要求</p><p> （一）高度重视，精心组织。全体工作人员要把整场活动作为丰富基层群众文化生活，切实做好活动的科学规划、统筹协调、精心组织、周密实施，确保这项活动顺利完成。</p><p> （二）加强组织领导。此次活动要求全体工作人员按时参加活动，并着文化志愿者马甲或佩戴文化志愿者胸牌。</p><p> （三）确保活动纪律。活动期间维持好纪律，活动中语言及行为要文明，说话要和气，服务要有耐心，绝对不允许出现迟到、早退、中途擅自离岗、大声喧哗、与群众发生争执等现象，坚决维护好自身形象。</p><p><br></p><p>     汉寿县文化馆</p><p> 2019年3月1日</p><p><br></p><p><img src="http://220.248.167.22/statics/image/2021/01/07/image_1610003581537.jpg"><img src="http://220.248.167.22/statics/image/2021/01/07/image_1610003588110.jpg"></p>',
