              '<p> 为丰富广大人民群众的精神文化生活，展示我县经济社会发展成果，提高全民文化素质，拟举办汉寿县“送文化进敬老院，送书画进万家”活动，结合我县实际，特制定如下实施方案：</p><p> 一、指导思想</p><p> <span style="color: black;">以党的十九大、习近平新时代中国特色社会主义思想为指导，落实基层文化建设，努力顺应人民群众对美好文化生活的新期盼，推进新时代乡村文化振兴，</span>深入挖掘春节的文化内涵，遵循简洁可行的的原则，培养和树立尊重传统、继承传统、弘扬传统的思想观念，增强全县人民对中华优秀文化的认同感和自豪感，着力营造欢乐、祥和、平安、健康、文明的节日氛围。</p><p> 二、活动主题：汉寿县“送文化进敬老院，送书画进万家”活动</p><p> 三、活动时间、地点</p><p> 活动时间：2019年1月24日14:30</p><p> 活动地点：汉寿县嘉佑养老服务中心</p><p> 四、主办、承办单位</p><p> 主办单位：汉寿县文体广新局</p><p> 承办单位：县文化馆、县非遗中心 </p><p> 五、组织机构</p><p> 组 长：张集中 </p><p> 副组长：杨冬英 徐铁军 彭立平 曹同丰 刘 丹</p><p> 陈建寰 刘桂堂</p><p> 成 员：白莉 罗先明 聂晓劲 殷良军 袁先平 </p><p> 杨森</p><p> 下设四个工作组：</p><p> 1、节目组</p><p> 组 长：杨冬英</p><p>成 员：彭立平 曹同丰  刘 丹 白 莉 聂晓劲 殷良军 罗先明  袁先平 易 琼 </p><p> 职 责：①负责节目审定；②负责落实节目；③负责声乐、舞蹈、器乐等节目形式的排练与辅导编排；④负责节目的顺序与节目单；⑤负责音频搜集、播放；⑥负责演出节目的调度；⑦负责书法展现场的设计与布置。</p><p> 2、宣传组</p><p> 组 长：王 杰</p><p> 成 员：周 飞 刘海洪 刘晓明 曹培培 吴香如</p><p> 职 责：①负责活动背景和现场主持；②负责演出现场摄像、图片采集；③负责活动宣传报道；④负责领导讲话稿的撰写；⑤负责书法作品展的前期宣传，增进活动知名度，调动书法爱好者参与活动的热情；⑥对作品进行拍照摄影。</p><p> 3、后勤组</p><p> 组 长：刘桂堂</p><p>成 员：聂晓劲 张莉芳 朱立新 杨 森 王稳芝</p><p> 职 责：①负责剧务工作；②负责演出现场花草及舞台背景的布置；③负责音响器材的租用。</p><p> 4.安全保卫组</p><p> 组 长：李 锋</p><p> 成 员：陈建寰 王立新 周 飞 杨 森</p><p> 职 责：①负责晚会的安全保卫、秩序维护工作；②负责电力、卫生保障。</p><p> 六、工作要求</p><p> （一）高度重视，精心组织。全体工作人员要把整场文艺晚会作为丰富基层群众文化生活，弘扬中华优秀传统文化的有力抓手，切实做好活动的科学规划、统筹协调、精心组织、周密实施，确保这项活动顺利完成。</p><p> （二）加强组织领导。此次活动要求全体工作人员按时参加活动，并着文化志愿者马甲或佩戴文化志愿者胸牌。</p><p> （三）确保活动纪律。活动期间维持好纪律，活动中语言及行为要文明，说话要和气，服务要有耐心，绝对不允许出现迟到、早退、中途擅自离岗、大声喧哗、与群众发生争执等现象，坚决维护好自身形象。</p><p> </p><p> </p><p> 汉寿县文化馆</p><p> 2019年1月17日</p><p><br></p><p><img src="http://220.248.167.22/statics/image/2021/01/07/image_1610002774666.jpg"><img src="http://220.248.167.22/statics/image/2021/01/07/image_1610002782387.jpg"></p>',
