            resourcedetail:
              '<p>        徜徉汉寿县城，您会看到许多躺卧或矗立的文化石，他们与花草相依，和文明相伴，静静的守候，默默地迎送，期待有心人赋予其灵性与活力。</p><p><br></p><p>        一、主办单位：汉寿县文化旅游广电体育局</p><p><br></p><p>        二、征集范围全县各界人士、汉寿籍在外人士、所有书法爱好者等。</p><p><br></p><p>        三、征集要求</p><p><br></p><p>        1.题字内容要结合文化石的外形，与周边建筑、环境协调，寓意深刻、内涵丰富、格调高雅、积极向上。</p><p><br></p><p>        2.题字立意须紧扣我县建设宜居、宜业、宜游环湖强县大背景，彰显大美汉寿文化底蕴与家国情怀。</p><p><br></p><p>        3.题字字数控制在四字以内，题字可单一提供内容，也可形成书法作品，注明文化石序号及内容寓意、内涵。</p><p><br></p><p>        四、文化石位置和规格（照片附后）。</p><p><br></p><p>        1 号文化石 位置：县委停车场前（面朝银水东路）</p><p>        尺寸：1.长 1.85 米，高 1.4 米</p><p><br></p><p>        2 号文化石 位置：县政府停车场前（面朝银水东路）</p><p>        尺寸：1.长 1.6 米，高 1.1 米</p><p><br></p><p>        3 号文化石 位置：县政府停车场前（面朝市民广场）</p><p>        尺寸：1.长 1.5 米，高 1.4 米</p><p><br></p><p>        4 号文化石 位置：汉寿德汉大道入口（面朝德汉大道）</p><p>        尺寸：1.高 1.77 米，宽 0.79 米</p><p><br></p><p>        5 号文化石 位置：汉寿市民广场（面朝龙阳国际）</p><p>        尺寸：1.长 3 米，高 0.75 米</p><p><br></p><p>        6 号文化石 位置：汉寿南高速入口（面朝县城）</p><p>        尺寸：1.长 1.26 米，高 1.4 米</p><p><br></p><p>        7 号文化石 位置：汉寿大道（面朝十字路口，背靠法院）</p><p>        尺寸：1.长 2 米，高 1.05 米</p><p><br></p><p>        五、评奖及采用</p><p><br></p><p>        1.县文旅广体局评审小组选出入围作品（每块文化石取三件入围作品），报送县专家评审组最后选定题字内容，题字内容一经采用，使用权归属县文旅广体局。</p><p><br></p><p>        2.最终采用的作品，县文旅广体局将颁发荣誉证书，同时予以奖金或冠名权，并聘请知名书法家书写或按原作品式样题写文化石。</p><p><br></p><p>        六、投稿要求</p><p><br></p><p>        1.作品可交打印彩色文稿或发送电子文稿至指定邮箱。</p><p>        地址：汉寿县龙阳中路 639 号文旅广体局办公室</p><p>        邮箱：285183354@QQ.com</p><p>        联系人：唐舟 联系电话 13517367929</p><p><br></p><p>        2.作品请注明姓名、联系方式。</p><p><br></p><p>        3.投稿截止日期为 2021 年 1 月 20 日。</p><p>        诚邀您的参与，您的作品将有机会永久镌刻在汉寿记忆里。</p><p>        附件：文化石实景照片</p><p><br></p><p><br></p><p class="ql-align-right">汉寿县文化旅游广电体育局</p><p class="ql-align-right">2020 年 12 月 23 日</p><p class="ql-align-right"><br></p><p class="ql-align-center">汉寿县城文化石布置位置（一号）</p><p class="ql-align-center"><img src="http://220.248.167.22/statics/image/2020/12/24/image_1608792697675.png"></p><p class="ql-align-center">位置：汉寿县委停车场前（面朝银水东路）</p><p class="ql-align-center">尺寸：1.长1.85米，高1.4米</p><p class="ql-align-center">2.长1.35米，高0.7米</p><p class="ql-align-center"><br></p><p class="ql-align-center"><br></p><p class="ql-align-center">汉寿县城文化石布置位置（二号）</p><p class="ql-align-center"><img src="http://220.248.167.22/statics/image/2020/12/24/image_1608792739548.png"></p><p class="ql-align-center">位置：汉寿县政府停车场前（面朝银水东路）</p><p class="ql-align-center">尺寸：长1.6米，高1.1米</p><p class="ql-align-center"><br></p><p class="ql-align-center">汉寿县城文化石布置位置（三号）<img src="http://220.248.167.22/statics/image/2020/12/24/image_1608792801183.png"></p><p class="ql-align-center">位置：汉寿县政府停车场前（面朝市民广场）</p><p class="ql-align-center">尺寸：长1.5米，高1.4米</p><p class="ql-align-center"><br></p><p class="ql-align-center"><br></p><p class="ql-align-center">汉寿县城文化石布置位置（四号）<img src="http://220.248.167.22/statics/image/2020/12/24/image_1608792839655.png"></p><p class="ql-align-center">位置：汉寿县德汉大道入口（面朝德汉大道,背靠湘北通程加油站）</p><p class="ql-align-center">尺寸：1.高1.77米，宽0.79米</p><p class="ql-align-center">2.朝上面宽0.83米，长0.86米</p><p class="ql-align-center"><br></p><p class="ql-align-center"><br></p><p class="ql-align-center">汉寿县城文化石布置位置（五号）<img src="http://220.248.167.22/statics/image/2020/12/24/image_1608792884942.png"></p><p class="ql-align-center">位置：汉寿县市民广场（面朝龙阳国际）</p><p class="ql-align-center">尺寸：长3米，高0.75米</p><p class="ql-align-center"><br></p><p class="ql-align-center"><br></p><p class="ql-align-center">汉寿县城文化石布置位置（六号）<img src="http://220.248.167.22/statics/image/2020/12/24/image_1608792935567.png"></p><p class="ql-align-center">位置：汉寿南高速公路入口（面朝县城）</p><p class="ql-align-center">尺寸：长1.26米，高1.4米</p><p class="ql-align-center"><br></p><p class="ql-align-center"><br></p><p class="ql-align-center">汉寿县城文化石布置位置（七号）<img src="http://220.248.167.22/statics/image/2020/12/24/image_1608793003586.png"></p><p class="ql-align-center">位置：汉寿大道（面朝十字路口,背靠法院）</p><p class="ql-align-center">尺寸：长2米，高1.05米</p>',
